library.remarks:
This is the sscanf plugin, which provides the sscanf function to extract basic structured data from strings. This is slightly different to regular expressions, but both have their place. A regular expression gives you total control over the exact structure of data down to the character level; however, extracting structured data like numbers using it is tricky. Conversely this gives slightly higher-level specifiers which can easily extract data types, at the expense of fine-grained control. To convert a string in to two numbers would look like: new num1, num2;
sscanf("45 100", "ii", num1, num2); ii is the specifier string, which here means "integer integer"; stating that the input string should be two whole numbers in a row (which is - "45 100"). num1 and num2 are the destination variables to store the found numbers in (after conversion from strings). You can check if the conversion failed by looking for a non-naught return value: new num1, num2;
if (sscanf("hello 100", "ii", num1, num2))
{
printf("The input was not two numbers.");
} This will fail because "hello" is not a whole number (or indeed any type of number at all). For more information on using the function refer to the tutorials or the reference documentation in the attached readme.

member.remarks:
The CELLMIN_ON_MATCHES option as a constant string so you can get compile-time spell checking on the name. Whatever the value of MATCH_NAME_PARTIAL, the first found player will always be returned, so if you do a search for _ on an RP server, you could get almost anyone. To detect this case, if more than one player will match the specified string then sscanf will return an ID of cellmin instead. This can be combined with U for a lot more power: sscanf(params, "?<CELLMIN_ON_MATCHES=1>U(-1)", id);
if (id == -1)
{
// No player was entered.
}
else if (id == cellmin)
{
// Multiple matches found
}
else if (id == INVALID_PLAYER_ID)
{
// Entered player is not connected.
}
else
{
// Found just one player.
}

This scans through the given sorted table to find one matching the given name pattern, or just the next one when no pattern is given. Loop over all public functions with:
new idx = 0, buffer;
while ((idx = AMX_GetPublicEntry(idx, buffer)))
{
}
The entry is a pointer in to the table itself, i.e. address/name pair relative to DAT. You should not use this function directly, but one of the macro wrappers defined for sorted tables:
AMX_GetPublicEntry AMX_GetPubVarEntry AMX_GetLibraryEntry AMX_GetTagEntry

This scans through the given sorted table to find one whose name starts with the given prefix. Prefixes are four bytes built from the first four characters in a name. Prefixes are used extensively for looping over special function types as they require no string decoding and so can be compared very quickly. The _A macro can be used to convert four characters in to the special format used by pattern (which is really just the C string as a 32-bit number).
y_hooks uses this function to find all of its special hook functions, which start with the magic four character sequence "@yH_" (both a prefix for this function, and a public function declaration as it starts with @), like so:
new idx = 0, buffer;
while ((idx = AMX_GetPublicEntryPrefix(idx, buffer, _A<@yH_>)))
{
}
The entry is a pointer in to the table itself, i.e. address/name pair relative to DAT. You should not use this function directly, but one of the macro wrappers defined for sorted tables:
AMX_GetPublicEntryPrefix AMX_GetPubVarEntryPrefix AMX_GetLibraryEntryPrefix AMX_GetTagEntryPrefix
Prefixes are widely used in YSI as the names are sorted and so can be binary searched, the entries point to the start of the names, and once a prefix is passed there can be no more later (thanks to sorting). Thus binary prefix searches are extremely efficient.

This scans through the given sorted table to find one whose name contains the given pattern, or all of them when there is no pattern. Loop over all the defined player callbacks like so:
new idx = 0, buffer[FUNCTION_LENGTH];
while ((idx = AMX_GetPublicName(idx, buffer, "OnPlayer", false)))
{
}
You should not use this function directly, but one of the macro wrappers defined for sorted tables:
AMX_GetPublicName AMX_GetPubVarName AMX_GetLibraryName AMX_GetTagName

This scans through the native table to find one matching the given name pattern, or just the next one when no pattern is given. Loop over all natives with:
new idx = 0, buffer;
while ((idx = AMX_GetNativeEntry(idx, buffer)))
{
}
The entry is a pointer in to the table itself, i.e. address/name pair relative to DAT.

This scans through the given unsorted table to find one whose name starts with the given prefix. Prefixes are four bytes built from the first four characters in a name. Prefixes are used extensively for looping over special function types as they require no string decoding and so can be compared very quickly. The _A macro can be used to convert four characters in to the special format used by pattern (which is really just the C string as a 32-bit number).
All the special Func: tags which encode parameter types could be looped over like so:
new idx = 0, buffer;
while ((idx = AMX_GetTagEntryPrefix(idx, buffer, _A<F@_@>)))
{
}
The entry is a pointer in to the table itself, i.e. address/name pair relative to DAT.

This scans through the given unsorted table to find one whose name contains the given pattern, or all of them when there is no pattern. Loop over all the defined player callbacks like so:
new idx = 0, buffer[FUNCTION_LENGTH];
while ((idx = AMX_GetPublicName(idx, buffer, "OnPlayer", false)))
{
}

This scans through the public variables table to find one matching the given name pattern, or just the next one when no pattern is given. Loop over all public variables with:
new idx = 0, buffer;
while ((idx = AMX_GetPubvarEntry(idx, buffer)))
{
}
The entry is a pointer in to the table itself, i.e. address/name pair relative to DAT.

This scans through the public variables table to find one whose name starts with the given prefix. Prefixes are four bytes built from the first four characters in a name. Prefixes are used extensively for looping over special function types as they require no string decoding and so can be compared very quickly. The _A macro can be used to convert four characters in to the special format used by pattern (which is really just the C string as a 32-bit number).
To loop over all public variables that start with "var_":
new idx = 0, buffer;
while ((idx = AMX_GetPubvarEntryPrefix(idx, buffer, _A<var_>)))
{
}
The entry is a pointer in to the table itself, i.e. address/name pair relative to DAT.

Creates fake constants that Pawndoc comments can be attached to in the first compilation phase, before the real macros are created. Macros can't have documentation comments, but why not? They need documenting...
Used internally as YSI_CONST_PAWNDOC.
This creates a static stock of the same name to attach the documentation to, before actually defining the macro.
#if defined MACRO_NAME
// `#define MACRO_NAME` exists previously, don't document it here.
_FIXES_HIDE_PAWNDOC(SIMILAR_NAME);
#else
// Doesn't exist. Document it and define it.
_FIXES_CONST_PAWNDOC(MACRO_NAME);
#define MACRO_NAME(%0) (%0)
#endif

Creates fake functions that Pawndoc comments can be attached to in the first compilation phase, before the real macros are created. Macros can't have documentation comments, but why not? They need documenting...
Used internally as YSI_FUNC_PAWNDOC.
This creates a native of the same name, then calls it from a special function (called PAWNDOC) with a state set to the name of this function, to avoid declaring multiple functions in the XML while ensuring that this fake function is in the XML. Natives aren't in the output unless they are called, but we don't have to call them correctly because the container function is never called. You do need a fallback version of `PAWNDOC` to catch all other state variations declared elsewhere in your script.
#if defined MACRO_NAME
// `#define MACRO_NAME` exists previously, don't document it here.
_FIXES_HIDE_PAWNDOC(SIMILAR_NAME);
#else
// Doesn't exist. Document it and define it.
_FIXES_FUNC_PAWNDOC(MACRO_NAME(parameters));
#define MACRO_NAME(%0) (%0)
#endif

Useful macros:
// HOLDING(keys)
#define HOLDING(%0) ((newkeys & (%0)) == (%0))
// PRESSED(keys)
#define PRESSED(%0) (((newkeys & (%0)) == (%0)) && ((oldkeys & (%0)) != (%0)))
// PRESSING(keyVariable, keys)
#define PRESSING(%0,%1) (%0 & (%1))
// RELEASED(keys)
#define RELEASED(%0) (((newkeys & (%0)) != (%0)) && ((oldkeys & (%0)) == (%0)))

If hittype is:
- BULLET_HIT_TYPE_NONE: the fX, fY and fZ parameters are normal coordinates, will give 0.0 for coordinates if nothing was hit (e.g. far object that the bullet can't reach);
- Others: the fX, fY and fZ are offsets relative to the hitid.

remarks.code:
// valstr fix by Slice
stock FIX_valstr(dest[], value, bool:pack = false)
{
// format can't handle cellmin properly
static const cellmin_value[] = !"-2147483648";
if (value == cellmin)
pack && strpack(dest, cellmin_value, 12) || strunpack(dest, cellmin_value, 12);
else
format(dest, 12, "%d", value), pack && strpack(dest, dest, 12);
}
#define valstr FIX_valstr
